import React from "react";

export const ListaHistorial = ({ envios }) => {
  return (
    <>
      {envios.map((envio) => (
        <div key={envio.id_viaje}>
          <p>{envio.id_viaje}</p>
        </div>
      ))}
    </>
  );
};
